-- Table structure for `running_log`
-- ----------------------------
DROP TABLE IF EXISTS `running_log`;
CREATE TABLE `running_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `spiderid` bigint(20) DEFAULT NULL COMMENT '爬虫id',
  `scheduleid` bigint(20) DEFAULT NULL COMMENT '调度id',
  `reason` varchar(255) DEFAULT NULL COMMENT '异常',
  `runningUrlInfo` varchar(255) DEFAULT NULL COMMENT '爬取url信息',
  `runningHouseInfo` varchar(255) DEFAULT NULL COMMENT '爬取房源信息',
  `cleanInfo` varchar(255) DEFAULT NULL COMMENT '房源清洗信息',
  `url` varchar(255) DEFAULT NULL COMMENT '对应url',
  `creation_date` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
